import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for the profile link and click it
    await page.waitForSelector('a:has-text("Your Profile")', { timeout: 5000 });
    await page.click('a:has-text("Your Profile")');

    // Take screenshot after clicking the profile link
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_profile_clicked.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_profile_clicked.png'));

    // Wait for the profile information to load
    await page.waitForSelector('.profile-info', { timeout: 5000 });

    // Extract profile information
    const profileData = await page.evaluate(() => {
      const username = document.querySelector('.username')?.textContent || '';
      const fullName = document.querySelector('.profile-info h2')?.textContent || '';
      const bio = document.querySelector('.bio')?.textContent || '';
      return { username, fullName, bio };
    });

    // Take final screenshot of the profile
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_profile_info.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_profile_info.png'));

    return {
      success: true,
      action: "Harvested user profile information",
      extractedData: profileData,
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
